    true,nt"url": null,nt"notes": "EDFacts Race To The Top, 2011-12 (EDFacts
    RTT:2011-12), is one of 17 'topics' identified in the EDFacts documentation (in
    this database, each 'topic' is entered as a separate study); program data is available
    since 2005 at <ed.gov/about/inits/ed/edfacts>. EDFacts RTT:2011-12 (ed.gov/about/inits/ed/edfacts)
    annually collects cross-sectional data from states about studentsufffd postsecondary
    enrollment and credits earned for high school graduates at the school, LEA, and
    state levels. EDFacts RTT:2011-12 data were collected using the EDFacts Submission
    System (ESS), a centralized portal and their submission by states is mandatory and
    required for benefits. Not submitting the required reports by a state constitutes
    a failure to comply with law and may have consequences for federal funding to the
    state. Key statistics produced from EDFacts RTT:2011-12 are from one data groups
    with information on High School Graduates Postsecondary Enrollment. For the purposes
    of this system, data group is referred to as 'variables', as a result of the structure
    and format of EDFacts' data.",nt"license_title": "Creative Commons CCZero",nt"extras":
